// }

    return(
        <div className={cookie.cookie}>
            <div className={cookie.cookie__content}>
                <p>We don't use cookies because we don't know how to make it</p>
                <button onClick={onClose}>Okay</button>
            </div>
        </div>
    )
}

export default Cookie;
